import React from 'react';
import Card from './Card';

const CardList = ({robots}) => {
    const CardComponent = robots.map(user => {
        <Card id={robots[user].id} name={robots[user].name} email={robots[user].email} />
    });
    return (
        <div>
            CardComponent;
        </div>
    )
}

export default CardList;
